import React from 'react';

function Navbar() {
    return (
        <div className="Navbar">
            <div classname='logo'>
                Sight
            </div>    
            <ul className='navbar-menu'>
                <li><a href="/">Home</a></li>
                <li><a href="/conversations">Conversations</a></li>
            </ul>
        </div>
    )
}   

export default Navbar;
